// UserList.js
import React from 'react';
import Blog_main from './Blog_main';

const UserList = ({ users }) => {
  return (
    <div className="user-list">
      {users.map((user, index) => (
        <Blog_main
          key={index}
          name={user.name}
          surname={user.surname}
          avatarUrl={user.avatarUrl}
        />
      ))}
    </div>
  );
};

export default UserList;
